const Home = () => {
  
  
  

  return (
    <div className="container mx-auto p-8 flex flex-col items-center justify-center min-h-screen ">
      <section className="text-center mb-12">
        <h1 className="text-5xl md:text-6xl font-extrabold mb-4 text-gray-800 dark:text-white">
          Welcome to Your App
        </h1>
        <p className="text-lg md:text-xl text-gray-600 dark:text-gray-400">
          This is the home page of your awesome React application. Customize this content to showcase what your app does.
        </p>
      </section>

      

      <section className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
        {/* Feature 1 */}
        <div className="bg-white dark:bg-gray-800 p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold mb-2 text-gray-800 dark:text-white">Feature 1</h2>
          <p className="text-gray-600 dark:text-gray-400">Description of Feature 1</p>
        </div>

        {/* Feature 2 */}
        <div className="bg-white dark:bg-gray-800 p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold mb-2 text-gray-800 dark:text-white">Feature 2</h2>
          <p className="text-gray-600 dark:text-gray-400">Description of Feature 2</p>
        </div>

        {/* Feature 3 */}
        <div className="bg-white dark:bg-gray-800 p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold mb-2 text-gray-800 dark:text-white">Feature 3</h2>
          <p className="text-gray-600 dark:text-gray-400">Description of Feature 3</p>
        </div>
      </section>
    </div>
  );
};

export default Home;
